import { useEffect, useState } from "react"
import allVideos from "./exampleresponse.json"

const VideoCard = () => {
    const [allMyVideos, setAllMyVideos] = useState([])
    useEffect(() => {
        setAllMyVideos(allVideos)
        console.log(allMyVideos)
    }, [])
    return (
        allMyVideos.map(video => {
            <div className="card">
                <div className="image-holder">
                    <img className="image-video" src={video.url}></img>
                </div>
                <div className="text-holder">
                    <h3>Title</h3>
                    <div className="rate">
                        <img></img>
                        <span>Number of votes</span>
                    </div>
                </div>
            </div >
        })
    )
}


export default VideoCard
